import Form from './form';
import React  from 'react';
import {BrowserRouter, Route} from 'react-router-dom';
import About  from './About';
import Home from './Home';
function App() {
  return (
    <>
    <BrowserRouter>
    <Route exact path="/" >
    <Home /> 
    <Form />
    </Route>
    <Route path="/about" render={()=><About />}/>
    <Route path="*">
      404 Page
    </Route>
    </BrowserRouter>

    </>
  );
}

export default App;
